import React from 'react'

const BotSpecs = ({onClose, bot}) => {

  // Function that handles the onclose button click
   const handleClickClose = () =>{
    onClose();
   }
  return (
    <div style={{backgroundColor:"yellow",}}>
     <img
        src={bot.image}
        alt={bot.name}
        className="card-img-top"
        style={{ backgroundColor: "grey" }}
      />

      {/*create a card body */}
      <div className="card-body">
        <h2 className="card-name" style={{ marginLeft: "70px" }}>
          {bot.name}
        </h2>
        <p className="card-text">{bot.phrase}</p>

        {/* create a div for icons */}
        <div style={{ marginLeft: "50px" }}>
          <i
            className="fas fa-heartbeat"
            style={{ fontSize: "12px", marginRight: "5px" }}
          ></i>
          <span style={{ fontSize: "15px" }}>{bot.health}</span>
          <i
            className="fas fa-bolt"
            style={{ fontSize: "12px", marginLeft: "15px" }}
          ></i>
          <span style={{ fontSize: "15px", marginLeft: "5px" }}>{bot.damage}</span>
          <i
            className="fas fa-shield-alt"
            style={{ fontSize: "12px", marginLeft: "15px" }}
          ></i>
          <span style={{ fontSize: "15px", marginLeft: "5px" }}>{bot.armor}</span>

          {/* Create a go button with the function handleclose */}
      <button  type="button" className="btn btn-primary" onClick={handleClickClose}>Go Back</button>
        </div>
      </div>
    </div>
  );
};


export default BotSpecs;
